                  </div>
                  <div className="nav-item">
                  <a href="about/">Skills</a>
                  </div>
                  <div className="nav-item">
                  <a href="about/">Portofolio</a>
                  </div>
                  <div className="nav-item">
                  <a href="about/"> Projects </a>
                  </div>
                  <div className="nav-item">
                  <a href="about/"> Blog </a>
                  </div>
            </div>


    </div>
        );
    }
}

export default Navbar;
